import React from "react";
import Header from "./Header.jsx";
import { ContainerPage } from "./ContainerPage.jsx";
import Footer from "./Footer.jsx";
import { Outlet } from "react-router-dom";

function HomePage() {
  return (
    <>
      <Header />
      <Outlet />
      <ContainerPage />
      <Footer />
      <Outlet />
    </>
  );
}

export default HomePage;
